import React from 'react';
import Footer from './footer'
import HomeNavBar from './navbar'

export default class Products extends React.Component{
    render(){
        return(
            <div>
                <HomeNavBar/>
                   <div>
                       <Container>
                           <Row>
                               <Col xs={4}>Menu</Col>
                               <Col></Col>
                           </Row>
                       </Container>
                   </div>
                <Footer/>
            </div>
        );
    }
}
